import React from 'react';
import { useLocation } from 'react-router-dom';

const CooperationTemplate = () => {
    const location = useLocation();

    // Извличаме информацията за проекта и сградата от навигацията
    const { projectTitle, building } = location.state || { projectTitle: "Unknown Project", building: { title: "Unknown Cooperation" } };

    return (
        <div>
            <h1>Cooperation: {building.title} in {projectTitle}</h1>
            <div className="buildings-container">
            <div>Description: {building.description}</div>
            <div>Rsp:{building.rsp}</div>
            <div>Stages: AKT 14, AKT 15{building.rsp}</div>

                <div className='card-body'>
                <div className="form-group">
              <label htmlFor="title">Title</label>
              <input
                type="text"
                className={`form-control`}
                id="title"
                name="title"
                placeholder="Title"
                
                onChange={handleInputChange}
              />
              {errors.title && <small className="text-danger">{errors.title}</small>}
            </div>
                </div>

                {/* Допълнително съдържание */}
            </div>
        </div>
    );
};

export default CooperationTemplate;
